import React, { useState, useEffect } from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import UserProvider from "./context/user-context";

import NavComponent from "./components/navbar-component";
import BobaComponent from "./components/boba-component";
import RegisterComponent from "./components/register-component";
import LoginComponent from "./components/login-component";
import Private from "./components/private-component";
import HomeComponent from "./components/home-component";
import AllListComponent from "./components/alllist-component";
import './App.css';
import 'bootstrap-icons/font/bootstrap-icons.css'

function App() {
  // const [loginState, setLoginState] = useState(UserService.isLogin());

  // useEffect(() => {
  //   if(loginState)
  //     console.log("Login");
  //   else
  //     console.log("not login");
  // }, [loginState])

  return (
    <div className="App">
      <UserProvider>
        <NavComponent/>
        <Routes>
          <Route path="/" exact element={<BobaComponent/>} />
          <Route path="/login" element={<LoginComponent/>} />
          <Route path="/register" element={<RegisterComponent/>} />
          <Route path="/home" element={<Private component={HomeComponent}/>} /> 
          <Route path="/mylist" element={<Private component={AllListComponent}/>} />
        </Routes>
      </UserProvider>
    </div>
  );
}

export default App;
